import React from "react";
import { Provider } from "react-redux";
import store from "./store";
import "./App.css";
import { BrowserRouter, Switch, Route } from "react-router-dom";

// components
import Indexgeuss from "./components/Geuss/indexgeuss";
import Login from "./components/login/loginclient";
import Indexclient from "./components/client/indexclient";
import Signupclient from "./components/signup/signupclient";
import Narbargeuss from "./components/Geuss/menu/menu";
import Signup_profesionnal from "./components/signup/signupprof";
function App() {
  return (
    <Provider store={store}>
      <BrowserRouter>
        <Switch>
          <Route exact path="/login">
            <Login />
          </Route>
          <Route exact path="/signupclient">
            <Narbargeuss />
            <Signupclient />
          </Route>
          <Route exact path="/signuppro">
            <Narbargeuss />
            <Signup_profesionnal />
          </Route>
          <Route exact path="/">
            <Indexgeuss />
          </Route>
          <Route path="/client">
            <Indexclient />
          </Route>
          <Route path="/pro">
            <Indexclient />
          </Route>
        </Switch>
      </BrowserRouter>
    </Provider>
  );
}

export default App;
